import scss from './section-business-cases.module.scss'

export const SectionBusinessCases = () => {
    return (
      <div className={scss.sectionCases}>
        <div className={scss.casesWrapper}>
          <p>This what we do</p>
          <h2>Business Cases</h2>
        </div>
      </div>
    );
}
